import React from 'react';

const BuyerDashboard = () => {
  return (
    <div>
      <h2>Buyer profile</h2>
      <p>Welcome, Buyer! Here you can browse products and make purchases.</p>
    </div>
  );
};

export default BuyerDashboard;
